import './Item.css';
function Item(props) {
    console.log(props)
    return (
        <div>
            <div className='follower_1'>
                <div className='circle'>{props.data.title}</div>
                <h4>{props.data.title}</h4>
                <button className='buttons'>VIEW PROFILE</button>
            </div>
        </div>
    )
}
export default Item;
